import React from 'react';
import { Link, Outlet } from 'react-router-dom'; // Import Outlet for rendering child routes
import '../styles/homepage.css';

const HomePage = () => {
  return (
    <div className="homepage">
      {/* Sidebar */}
      <aside className="sidebar">
        <div className="logo">
          <h2>InvoiceQuick</h2>
        </div>
        <nav>
          <ul>
            <li><Link to="/homepage/dashboard">Dashboard</Link></li>
            <li><Link to="/homepage/invoices">Invoices</Link></li>
            <li><Link to="/homepage/reminders">Reminders</Link></li>
            {/* Add other links here */}
          </ul>
        </nav>
      </aside>

      {/* Main content area */}
      <main className="main-content">
        <Outlet /> {/* This will render the content of the selected page */}
      </main>
    </div>
  );
};

export default HomePage;
